import styled from "styled-components";

export const Container = styled.div`
    padding: 16px;
    border: solid 1px #f5f5f5;
    background-color: #fff;
    width: 100%;
    margin: 16px 4px;
    min-height: 500px;

    .tbl {
        width: 100%;
        margin-top: 16px;
    }

    .tbl th, .tbl td {
        border: solid 1px #e0e0e0;
        padding: 5px;
    }
`
